## Backgroud

The following issue is a follow-up issue of #614.
The point is to make it easy to use SQL function `IFNULL` via method chaining.

## Task

The following issue is to implement the `ifnull` function in `ast_builder` module to support the `IfNull` function in the query builder.

Following tests should pass in order to complete the following task.

```rust
#[test]
fn ifnull_function() {
    let actual = col("updated_at").ifnull(col("created_at"));
    let expected = "IFNULL(updated_at, created_at)";
    test_expr(actual, expected);

    let actual = text("HELLO").ifnull(text("WORLD"));
    let expected = "IFNULL('HELLO', 'WORLD')";
    test_expr(actual, expected);
}
```

- `three` version: 0.137.4
- `@react-three/fiber` version: 7.0.26
- `@react-three/drei` version: 8.7.4
- `node` version: 16.5.0
- `npm` (or `yarn`) version: 1.22.17

### Problem description:

When using `Instances` or `Merged` and adding mesh items, they appear in the center of the scene with no transforms at (0, 0, 0) for a split second (well, 1 frame), before receiving the proper transformation.

The problem can be seen in this Codesandbox: https://codesandbox.io/s/instances-skipping-an-update-m90kx3?file=/src/App.js:207-806

Click on the button to add a cube. It should not flicker in the center.

### Relevant code:

There seems to be a comment that is likely related to this in `Instances.tsx`: https://github.com/pmndrs/drei/blob/master/src/core/Instances.tsx#L76

```jsx
    React.useEffect(() => {
      // We might be a frame too late? 🤷‍♂️
      parentRef.current.instanceMatrix.needsUpdate = true
    })
```

To reproduce (same code as the Codesandbox):

```jsx
const geometry = new BoxGeometry()
const material = new MeshStandardMaterial({ color: '#f00' })

export default function App() {
  const [cubes, setCubes] = useState([])

  return (
    <>
      <button onClick={() => setCubes((x) => [...x, { id: Math.random(), pos: [1, 1, 1] }])}>Add cube</button>
      <Canvas>
        <ambientLight intensity={4} />
        <Instances material={material} geometry={geometry}>
          {cubes.map((c) => (
            <Instance key={c.id} position={c.pos} />
          ))}
        </Instances>
        <OrbitControls makeDefault />
      </Canvas>
    </>
  )
}
```

Is there any possible workaround in the meantime?

### Description

I deliberately avoid the callable type in my code because it produces misleading error messages. 

Examples:

```php
$cb = [PhpTokn::class, 'tokenize']; // typo in class name

(fn(callable $cb) => 0)($cb); 
// expected error: Argument #1 ($cb) must be of type callable, but class "PhpTokn" does not exist
// actual error: Argument #1 ($cb) must be of type callable, array given 
```

```php
$cb = [PhpToken::class, 'tokenze']; // typo in method name

(fn(callable $cb) => 0)($cb); 
// expected error: Argument #1 ($cb) must be of type callable, but method PhpToken::tokenze() does not exist
// actual error: Argument #1 ($cb) must be of type callable, array given 
```

```php
$cb = 'PhpTokn::tokenize'; // typo in class name

(fn(callable $cb) => 0)($cb); 
// expected error: Argument #1 ($cb) must be of type callable, but class "PhpTokn" does not exist
// actual error: Argument #1 ($cb) must be of type callable, string given 
```

```php
$cb = 'PhpToken::tokenze'; // typo in method name

(fn(callable $cb) => 0)($cb); 
// expected error: Argument #1 ($cb) must be of type callable, but method PhpToken::tokenze() does not exist
// actual error: Argument #1 ($cb) must be of type callable, string given 
```

Not only does the error message not tell you exactly what is wrong with the callback, but it is also little misleading. Message *Must be callable, array given* suggests, that something other than array (or string) was expected. 

Thanks for your consideration.

When a new hero image file is uploaded, set the old one to temporary and remove the file usage.

Something like:
`$file = Drupal\file\Entity\File::load($old_file_id);  

$file->setTemporary();  

$file->save();  

$file_usage = \Drupal::service('file.usage');  

$file_usage->delete($file, 'welcome');`

