*Description*:
I am trying to migrate from Nginx to Envoy. There are a lot of regex configs only match a subsequence of the uri. But Enovy's `safe_regex` forces to match the entire uri. So could envoy support this scene through `re2::RE2::PartialMatch`?

[optional *Relevant Links*:]
Nginx regex match use `pcre_exec`: https://www.pcre.org/original/doc/html/pcre_exec.html
It performs like this:
```
Source Code:
    pcre *re = pcre_compile("^/a", 0, &errstr, &erroff, NULL);
    if (re == NULL) {
        printf("regex compile failed: %s", errstr);
        return 1;
    }
    char *subjects[4] = {"/a", "/a/b/c", "/a/c", "/b/c"};
    for (int i=0; i<4; i++) {
        char *subject = subjects[i];
        int rc = pcre_exec(re, NULL, subject, strlen(subject), 0, 0, NULL, 0);
        printf("%s match result %d\n", subject, rc);
    }

Output:
/a match result 0
/a/b/c match result 0
/a/c match result 0
/b/c match result -1
```
